import React from 'react';
import { useNavigate } from 'react-router-dom';

const SelectImagePage: React.FC = () => {
  const navigate = useNavigate();

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-white">
      <h1 className="text-2xl font-bold mb-6 text-black">選擇 Base Image</h1>
      <div className="w-80 h-48 bg-purple-50 border-2 border-dashed border-purple-200 rounded-lg flex items-center justify-center text-gray-400 text-lg mb-8">
        這裡將顯示可選擇的圖片
      </div>
      <button
        onClick={() => navigate(-1)}
        className="px-6 py-2 bg-purple-600 text-white rounded-lg hover:bg-purple-700"
      >
        返回
      </button>
    </div>
  );
};

export default SelectImagePage;
